                ele.style.height = hStr;
				for (var i = 0; i < ele.children.length; i++)

						ele.children[i].style.width = wStr;

                ele.style.width = wStr;
                ele.style.height = hStr;
            }
        }
    }
	
	function imgLoaded(row) {
